import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react';

class App extends Component
{
  constructor()
  {
    super();
    this.state = {
      monsters:[
        {
          name : 'Frankenstein',
          id: 'asdc'
        },
        {
          name : 'Dracula',
          id: 'gvargv'
        },
        {
          name : 'Zombie',
          id:'dvsdvs'
        },
      ] 
    };

  }
  render(){
    return (
      <div className="App">
        {
          this.state.monsters.map(monsters => <h1 >{monsters.name}</h1>)

        }
      </div>
    );
  }
}

export default App;
